import React from 'react';
import './App.css';
import Stripe from './Stripe';
export default function DesignProject(props) {
    return (
        <div>
            <div className="row">
                <h1 className="col-6">{props.title}</h1>
                <p className="col-6">{props.summary}</p>
                <Stripe />
            </div>
            <div className="row mt-4">
                <div className="col-4">
                    <p className="design-project-header-info">ROLE</p>
                    <p>{props.role}</p>
                </div>
                <div className="col-4">
                    <p className="design-project-header-info">TIMELINE</p>
                    <p>{props.timeline}</p>
                </div>
                <div className="col-4">
                    <p className="design-project-header-info">TOOLS</p>
                    <p>{props.tools}</p>
                </div>
            </div>
            <img className="img-fluid mb-4 mt-3" src={require("./assets/" + props.mainImg)}></img>
            <div>
                {props.p1Header ? <h3>{props.p1Header}</h3> : <p></p>}
                {props.p1 ? <p>{props.p1}</p> : <p></p>}
                {props.p1Img ? <img className="img-fluid mb-4 mt-3" src={require("./assets/" + props.p1Img)}></img> : <p></p>}
            </div>

        </div>
    );
}

function DesignProjectSection(props) {
    return (
        <div>
            <h3>{props.header}</h3>
            <p>{props.text}</p>
            <img className="img-fluid mb-4 mt-3" src={require("./assets/" + props.img)}></img>
        </div>
    );
}
